import React from 'react';
import './styles.css';
import './w3.css';
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import  {Homepage} from'./Homepage.js';
import  {About} from'./About.js';
import  {CharityPartners} from'./CharityPartners.js';
import  {BusinessPartners} from'./BusinessPartners.js';
import  {CharityEvents} from './CharityEvents.js';
import {useState} from 'react';

const getFilteredItems = (query, items) => {
	if (!query){
		return items;
	}
	return items.fiter((song)=> song.name.includes(query));

};




function App() {
    const [query, setQuery] = useState("");
	 const { tracks } = THANK_U_NEXT;
	const { items } = tracks;
  // items looks like this: [{name: 'name1'}, {name: 'name2'}]

	const filteredItems = getFilteredItems(query, items);

	return (
	<div className="App">
      <label>Search</label>
      <input type="text" onChange={(e) => setQuery(e.target.value)} />
      <ul>
        {filteredItems.map((value) => (
          <h1 key={value.name}>{value.name}</h1>
        ))}
      </ul>

    <Router>
      <Routes>
        <Route exact path="/" element={<Homepage/>} />
        <Route path="/about" element={<About/>} />
		<Route path="/charitypartners" element={<CharityPartners/>} />
		<Route path="/businesspartners" element={<BusinessPartners/>} />
		<Route path="/charityevents" element={<CharityEvents/>} />
      </Routes>
    </Router>
  </div>

  );


}

export default App;
